import React from 'react';
function AboutUs(){
    return(
        <div className='main-content'>
            <div className='about'>
                <h2>About Us</h2>
                <h2>Welcome to Gradious Doctor Appointment Booking!</h2>
                <h2>Our Mission</h2>
                <p>
                At Gradious, our mission is to simplify and streamline the process 
                of booking medical appointments. We understand that your health is precious, 
                and we want to make it easy for you to access the care you need. 
                With our user-friendly platform, you can schedule appointments with trusted healthcare 
                professionals in just a few clicks.
                </p>
            </div>
        </div>

    )    
}

export default AboutUs;
